import React from 'react';

import './RegisterScreenComp.css';

import { Link } from 'react-router-dom';

const RegisterScreenComp = () => {
	return (
		<div className="registerscreen">
			<div className="register-container">
				<i class="fas fa-user-circle" style={{ fontSize: '50px' }} />
				<h2 className="register-title">Register</h2>
				<label className="register-labels">Username</label>
				<input type="text" onChange={e => console.log(e.target.value)} />
				<label className="register-labels">Password</label>
				<input type="password" onChange={e => console.log(e.target.value)} />
				<button className="register-btn" onClick={console.log('Submitted!')}>
					Sign Up
				</button>
				<p className="register-link">
					Already have an account? <Link to="/login">Sign In!</Link>
				</p>
			</div>
		</div>
	);
};

export default RegisterScreenComp;
